Madagascar, Lemurs and Spies

Nature Documentary hosted by David Attenborough, published by BBC broadcasted as part of BBC Natural World series in 2012 - English narration


Information
------------------------------

Natural World: Madagascar, Lemurs and Spies
BBC's classic wildlife series which tells in-depth stories of incredible animals, featuring award-winning photography in some of the most extraordinary places in the world.
Pure white lemurs called silky sifaka live in the remote rainforests of Madagascar. They are one of the rarest animals in the world. Now a passionate scientist joins forces with an undercover detective to investigate whether there is a link between these endangered lemurs, illegal logging and expensive guitars in the USA.
Narrated by David Attenborough

